import React from "react";
import './Nav.scss';
import {
    Link , NavLink
  } from "react-router-dom";
  


class Nav extends React.Component {
        render() {
            return (
                <div className="topnav">
                    <Link to="/">Home</Link>
                    <Link to="/todo">Todo App</Link>
                    <Link to="/about">About</Link>

                    


                </div>
            )
        }
}

export default Nav;
